Subtract date in query<p>My objective is to get all documents where the field "myDate" is older than the actual date minus one month.</p>

<p>I tried this :</p>

<pre><code>db.getCollection("MyCollection").find
(
    { "$and" :
        [
            {"myDate": {$ne:null} },
            {"myDate": {$lt: {$subtract: [ISODate(), 1000*60*60*24*30 /* 30 days */]} } }
        ]
    }
)
</code></pre>

<p>It seems to not working when I put instructions in the $lt. If I put only Date like below, it's work :</p>

<pre><code>db.getCollection("ScheduledTasks").find
(
    { "$and" :
        [
            {"Context.Object.LastFilterDate": {$ne:null} },
            {"Context.Object.LastFilterDate": {$lt: ISODate() } }
        ]
    }
)
</code></pre>

<p>An example value of my field myDate is 2018-12-05T14:57:25.466+0000 and detected by Studio3T to Date type.</p>

