Query to get latest three users, sort by date - Mongoose Node.js<p><strong>This is the data from Mongodb</strong>
(Task.json)</p>

<pre><code>    {
        "username": "john",
        "taskId": "001",
        "date": "2020-02-18T20:14:19.000Z",
    },
    {
        "username": "david",
        "taskId": "001",
        "date": "2020-02-18T21:48:19.000Z",
    },
    {
        "username": "john",
        "taskId": "002",
        "date": "2020-02-15T20:20:32.000Z",
    }
    ... many more
</code></pre>

<p><strong>What I am trying to acheive</strong></p>

<ul>
<li>I am trying a write a query that returns <code>taskId</code> with a list of the
latest <code>users</code> who executed the task (sorted by <code>date</code> - descending).</li>
<li>I only want the last three users who executed the task to show up on the list, thus the <code>user</code> array should not contain more the 3 users per task</li>
</ul>

<p><strong>Here is an example I created of how I want the response to be:</strong></p>

<pre><code>{
  "tasks": [
    {
      "taskid": "001",
      "users": [
        {
          "username": "david",
          "date": "2020-02-18T21:48:19.000Z"
        },
        {
          "username": "john",
          "date": "2020-02-18T20:14:19.000Z"
        }
      ]
    },
    {
      "taskid": "002",
      "users": [
        {
          "username": "john",
          "date": "2020-02-15T20:20:32.000Z"
        }
      ]
    }
  ]
}
</code></pre>

<p><strong>My progress so far:</strong></p>

<pre><code>router.route("/latest-tasks").get((req, res) =&gt; {
    Task.find()
        .sort({ date: "desc" })
        .then(doc =&gt;
            res.status(200).json({
                taskId: doc.taskId,
                list: doc.map(doc =&gt; {
                    return {
                        username: doc.username,
                        date: doc.date
                    };
                })
            })
        )
        .catch(err =&gt; res.status(400).json("Error: " + err));
});
</code></pre>

