how to replace multiple occurrences of a phrase mongodb<p>I am trying to replace multiple occurrences of the same phrase in the same field.</p>

<p>Here is an example of the field 'imageUrl' contents:</p>

<blockquote>
  <p>"imageUrl" : "<a href="https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_2000x.png?v=1576212956" rel="nofollow noreferrer">https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_2000x.png?v=1576212956</a>\n \n <a href="https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_2000x.png?v=1576212956" rel="nofollow noreferrer">https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_2000x.png?v=1576212956</a>\n \n \n"</p>
</blockquote>

<p>My current formula: </p>

<pre><code>  {
      $match: {
           imageUrl: { $regex: "_2000x" },
           brand: "Goat The Label"
      }
  },
  { 
      $addFields: { 
          imageUrl: { $split: [ "$imageUrl", "_2000x" ] } 
      } 
  },
  { 
      $addFields: { 
          imageUrl: { 
              $concat: [ 
                        { $arrayElemAt: [ "$imageUrl", 0 ] }, 
                        "_850x", 
                        { $arrayElemAt: [ "$imageUrl", 1 ] }
              ] 
          }
      }
 }]).forEach( doc =&gt; db.product.updateOne( { _id: doc._id }, { $set: { imageUrl: doc.imageUrl } } ) )
</code></pre>

<p>Converts the following to:</p>

<blockquote>
  <p>"imageUrl" : "<a href="https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_850x.png?v=1576212956" rel="nofollow noreferrer">https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_850x.png?v=1576212956</a>\n \n \n"```</p>
</blockquote>

<p>However, im looking for the output to be:</p>

<blockquote>
  <p>"imageUrl" : "<a href="https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_850x.png?v=1576212956" rel="nofollow noreferrer">https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_850x.png?v=1576212956</a>\n \n <a href="https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_850x.png?v=1576212956" rel="nofollow noreferrer">https://cdn.test.com/s/files/1/0035/4671/0061/products/Screen_Shot_2019-12-13_at_12.47.01_pm_850x.png?v=1576212956</a>\n \n \n"</p>
</blockquote>

<p>Both urls still present and adapted to the <code>_850x</code> dimension. </p>

<p><strong>Note:</strong> The field input may be more then one Url (could contain 2-7).</p>

<p>Thanks in advance for any assistance</p>

