Merge documents from 2 collections in MongoDB & overwrite properties on a field<p>I have 2 collections in MongoDB :</p>

<p><strong>Collection1 :</strong></p>

<pre class="lang-js prettyprint-override"><code>{
    _id:1,            
    Field1: "Some info",
    Field2: "Some other info",
    Elements: [
        {
            id: 0,
            Enabled: false
        },
        {
            id: 1,
            Enabled: false
        },
        {
            id: 2,
            Enabled: false
        }
    ]
 }
</code></pre>

<p><strong>Collection2 :</strong></p>

<pre class="lang-js prettyprint-override"><code>{
    Identifier: "identifier",
    ElementsOverride: [
        {
            id: 0,
            Enabled: true                    
        },
        {
            id: 1,
            Enabled: false
        },
        {
            id: 2,
            Enabled: true                    
        }
    ]
 }
</code></pre>

<p>What I would like to do is perform an operation which flattens "Element" collection and returns Collection1 with the flattened Element collection (basically the Enabled field from collection 2 overwrites the enabled field of Collection 1. </p>

<p>Is there a way to achieve this in Mongodb?</p>

<hr>

<p>Adding more clarification for what the output should be like:
Essentially what I'm trying to do is merge the document identified by <code>_id:1</code> in collection 1 (document1), with the document identified by Identifier: "identifier" in collection 2 (document 2) such that:</p>

<ul>
<li>All the properties in document1 and document2 are available in the output.</li>
<li>The ElementsOverride from document2 with the same ID's as document1 (ex; <code>id: 0</code>) will overwrite the values in document1</li>
</ul>

<p><strong>Required Output :</strong></p>

<pre><code>{
    _id:1,     
    Identifier: "identifier",       
    Field1: "Some info",
    Field2: "Some other info",
    Elements: [
        {
            id: 0,
            Enabled: true
        },
        {
            id: 1,
            Enabled: false
        },
        {
            id: 2,
            Enabled: true
        }
    ]
 }
</code></pre>

